local placeIdTable = getgenv().Games or {}  -- Check for existing Games table, create empty if not found

if game.PlaceId then  -- Ensure PlaceId is available
    for id, scriptUrl in pairs(placeIdTable) do
        if id == game.PlaceId then
            local script = game:HttpGet(scriptUrl)

            if script then
                loadstring(script)()
                print("Executed script for place ID:", id)
            else
                print("Failed to fetch script for place ID:", id)
            end
            break  -- Exit the loop after finding a match
        end
    end
end

